import { Container, Grid } from '@material-ui/core';
import React from 'react';
import './App.css';

function App() {
  return (
    <Container>
      <Grid container>
        <Grid item lg={3} md={4} ></Grid>
      </Grid>
    </Container>
  );
}

export default App;
